import React from 'react';
//import './Nav.css';
import Hamburger from './Hamburger';

const Nav = () => {
    return(
        <div class="nav">
                <Hamburger />
            <div id="menu">
                <h3>Menu</h3>
                    <ul>
                        <li><a href="#secondPage">Who I Am</a></li>
                        <li><a href="#thirdPage">Things I Do</a></li>
                        <li><a href="#seventhPage">Talk To Me</a></li>
                    </ul>
            </div>
        </div>
    )
}

export default Nav;
